import React,{useState} from 'react'
import Navbar from '../components/Nav';
import Sidebar from '../components/Sidebar';
function Home() {
    const[isOpen,setIsOpen]=useState(false)
    const toggle=()=>{
        setIsOpen(!isOpen)
    }
    return (
        <>
         <Sidebar toggle={toggle} isOpen={isOpen}/> 
         <Navbar toggle={toggle}/>  
        </>
    )
}

export default Home
